		vl::Ptr<vl::parsing::tabling::ParsingTable> WfLoadTable()
		{
			vl::stream::MemoryStream stream;
			WfGetParserBuffer(stream);
			vl::Ptr<vl::parsing::tabling::ParsingTable> table=new vl::parsing::tabling::ParsingTable(stream);
			table->Initialize();
			return table;
		}

